Description:
>>Mô tả công việc<< 
- Viết bài lên website, các diễn đàn, blog, các mạng xã hội theo kế hoạch của người phụ trách; 
- Viết bài chia sẻ trên Fb, G+; 
- Chăm sóc, phát triển Social theo hướng dẫn; 
- Tìm kiếm và đăng ký diễn đàn; 
- Triển khai chiến dịch link building dự án…; 
- Xây dựng và phát triển vệ tinh theo hướng dẫn. 
>>Yêu cầu<< 
- Có Laptop cá nhân; 
- Đang là sinh viên hoặc đã tốt nghiệp các trường Cao đẳng/ Đại học chuyên ngành Công nghệ thông tin, Thương mại điện tử, Tin học ứng dụng và các chuyên ngành khác có liên quan; 
- Có kiến thức hiểu biết xã hội để ứng dụng trong công việc; 
- Có khả năng viết bài và diễn đạt ý, biên tập nội dung tốt; 
- Sử dụng tốt tin học văn phòng; 
- Ưu tiên sinh viên có thành tích SEO tốt và có kinh nghiệm hoạt động tại Forum, diễn đàn, Blog hoặccó đam mê tìm hiểu và học hỏi vể SEO; 
- Có khả năng viết tiếng Anh là lợi thế; 
- Có thể đến Công ty làm việc (được chọn partime hoặc fulltime). 
>>Quyền lợi<< 
- Bổ sung kiến thức nền tảng về SEO và được đào tạo thêm những kỹ năng để phục vụ cho công việc; 
- Khả năng tự xây dựng kế hoạch SEO hoàn chỉnh; 
- Hoàn thiện các kỹ năng về SEO qua sự trải nghiệm các dự án thực tế; 
- Có cơ hội phát triển thành nhân viên chính thức của Công ty nếu có khả năng và mong muốn hợp tác lâu dài; 
- Lương cứng cạnh tranh, mức thưởng thêm hấp dẫn xứng đáng với năng lực và đóng góp; 
- Môi trường làm việc chuyên nghiệp, năng động, thân thiện.
